import React, { useState } from 'react';
import { Modal, AlertModal } from './Modal';

export const FeedbackModal = ({ isOpen, onClose }) => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    type: 'feedback',
    message: ''
  });
  const [showSuccess, setShowSuccess] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create email body
    const subject = `[Verified Text Editor] ${formData.type.charAt(0).toUpperCase() + formData.type.slice(1)}`;
    const body = `Name: ${formData.name}
Email: ${formData.email}
Type: ${formData.type}

Message:
${formData.message}`;

    // Use mailto link
    const mailtoLink = `mailto:vanthuyphan@gmail.com?subject=${encodeURIComponent(subject)}&body=${encodeURIComponent(body)}`;
    window.location.href = mailtoLink;

    // Show success message
    setShowSuccess(true);

    // Reset form
    setFormData({
      name: '',
      email: '',
      type: 'feedback',
      message: ''
    });
  };

  return (
    <>
      <Modal isOpen={isOpen} onClose={onClose} title="Send Feedback" size="medium">
        <form onSubmit={handleSubmit}>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '16px' }}>
            <div>
              <label style={{ display: 'block', marginBottom: '6px', fontSize: '14px', fontWeight: '500', color: '#374151' }}>
                Name
              </label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                placeholder="Your name"
                style={{
                  width: '100%',
                  padding: '10px 12px',
                  border: '1px solid #d1d5db',
                  borderRadius: '6px',
                  fontSize: '15px',
                  fontFamily: 'inherit',
                  transition: 'all 0.2s'
                }}
              />
            </div>

            <div>
              <label style={{ display: 'block', marginBottom: '6px', fontSize: '14px', fontWeight: '500', color: '#374151' }}>
                Email
              </label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
                placeholder="your@email.com"
                style={{
                  width: '100%',
                  padding: '10px 12px',
                  border: '1px solid #d1d5db',
                  borderRadius: '6px',
                  fontSize: '15px',
                  fontFamily: 'inherit',
                  transition: 'all 0.2s'
                }}
              />
            </div>

            <div>
              <label style={{ display: 'block', marginBottom: '6px', fontSize: '14px', fontWeight: '500', color: '#374151' }}>
                Type
              </label>
              <select
                name="type"
                value={formData.type}
                onChange={handleChange}
                style={{
                  width: '100%',
                  padding: '10px 12px',
                  border: '1px solid #d1d5db',
                  borderRadius: '6px',
                  fontSize: '15px',
                  fontFamily: 'inherit',
                  backgroundColor: 'white',
                  transition: 'all 0.2s'
                }}
              >
                <option value="feedback">General Feedback</option>
                <option value="bug">Bug Report</option>
                <option value="feature">Feature Request</option>
                <option value="question">Question</option>
                <option value="other">Other</option>
              </select>
            </div>

            <div>
              <label style={{ display: 'block', marginBottom: '6px', fontSize: '14px', fontWeight: '500', color: '#374151' }}>
                Message
              </label>
              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
                placeholder="Share your thoughts, report a bug, or suggest a feature..."
                rows="6"
                style={{
                  width: '100%',
                  padding: '10px 12px',
                  border: '1px solid #d1d5db',
                  borderRadius: '6px',
                  fontSize: '15px',
                  fontFamily: 'inherit',
                  resize: 'vertical',
                  transition: 'all 0.2s'
                }}
              />
            </div>

            <div style={{
              padding: '12px',
              backgroundColor: '#fef3c7',
              borderRadius: '6px',
              fontSize: '13px',
              color: '#92400e'
            }}>
              <strong>Note:</strong> This will open your default email client. If it doesn't work, please email directly to{' '}
              <a href="mailto:vanthuyphan@gmail.com" style={{ color: '#1d4ed8', textDecoration: 'underline' }}>
                vanthuyphan@gmail.com
              </a>
            </div>

            <div style={{ display: 'flex', gap: '12px', justifyContent: 'flex-end', marginTop: '8px' }}>
              <button
                type="button"
                onClick={onClose}
                className="btn btn-secondary"
              >
                Cancel
              </button>
              <button
                type="submit"
                className="btn btn-primary"
              >
                Send Feedback
              </button>
            </div>
          </div>
        </form>
      </Modal>

      <AlertModal
        isOpen={showSuccess}
        onClose={() => {
          setShowSuccess(false);
          onClose();
        }}
        title="Thank You!"
        message="Your feedback is important to us. Your email client should now open with your message pre-filled. If it doesn't open automatically, please email vanthuyphan@gmail.com directly."
        type="success"
      />
    </>
  );
};
